import React, { useState, useEffect } from 'react';
import { useMutation } from '@apollo/client';

export default function Pedido({ pedido }) {
  const {
    id,
    total,
    cliente: { nombre, telefono, email },
    estado,
    cliente,
  } = pedido;
}
